function make_nice_header(a){a=a.replace("_"," ");a=a.toLowerCase();return a.replace(/(^| )(\w)/g,function(b){return b.toUpperCase()})}function getRoleNameForKey(a){switch(a){case"leader":return"Group Leader";default:return make_nice_header(a)}}function getMonthForShort(a){switch(a){case"jan":return"January";case"feb":return"February";case"mar":return"March";case"apr":return"April";case"may":return"May";case"jun":return"June";case"jul":return"July";case"aug":return"August";case"sep":return"September";case"oct":return"October";case"nov":return"November";case"dec":return"December";default:return a}}function getPaperTypeForKey(a){switch(a){case"journal":return"Journal Article";case"proceedings":return"Conference";case"techreport":return"Technical Report";default:return make_nice_header(a)}}function getReferenceForProceeding(a){var b="";if("author" in a&&a.author!==""){b+=a.author+". "}if("title" in a&&a.title!==""){b+=a.title+". "}if("booktitle" in a&&a.booktitle!==""){b+=a.booktitle+", "}if("location" in a&&a.location!==""){b+=a.location+", "}if("month" in a&&a.month!==""){b+=getMonthForShort(a.month)+", "}if("year" in a&&a.year!==""){b+=a.year+", "}if(b.substr(b.length-2)===", "){b=b.substr(0,b.length-2)+". "}if("note" in a&&a.note!==""){b+='<span class="label label-success">'+a.note+"</span> "}return b}function getReferenceForArticle(a){var b="";if("author" in a&&a.author!==""){b+=a.author+". "}if("title" in a&&a.title!==""){b+=a.title+". "}if("journal" in a&&a.journal!==""){b+="In <em>"+a.journal+"</em>, "}if("volume" in a&&a.volume!==""){b+="vol. "+a.volume+", "}if("number" in a&&a.number!==""){b+="no. "+a.number+", "}if("pages" in a&&a.pages!==""){b+="pp. "+a.pages+", "}if("month" in a&&a.month!==""){b+=getMonthForShort(a.month)+", "}if("year" in a&&a.year!==""){b+=a.year+", "}if(b.substr(b.length-2)===", "){b=b.substr(0,b.length-2)+". "}if("note" in a&&a.note!==""){b+='<span class="label label-success">'+a.note+"</span> "}return b}function getReferenceForTechReport(a){var b="";if("author" in a&&a.author!==""){b+=a.author+". "}if("title" in a&&a.title!==""){b+=a.title+", "}if("number" in a&&a.number!==""){b+="Technical Report "+a.number+", "}if("institution" in a&&a.institution!==""){b+=a.institution+", "}if("month" in a&&a.month!==""){b+=getMonthForShort(a.month)+", "}if("year" in a&&a.year!==""){b+=a.year+", "}if(b.substr(b.length-2)===", "){b=b.substr(0,b.length-2)+". "}if("note" in a&&a.note!==""){b+='<span class="label label-success">'+a.note+"</span> "}return b}function getReferenceForBook(a){var b="";if("author" in a&&a.author!==""){b+=a.author;if("year" in a&&a.year!==""){b+=" ("+a.year+")"}b+=". "}if("title" in a&&a.title!==""){b+=a.title+". "}if("publisher" in a&&a.publisher!==""){b+=a.publisher+". "}if("note" in a&&a.note!==""){b+='<span class="label label-success">'+a.note+"</span> "}return b}function getBibtexForProceeding(c,b){var a="@inproceedings{\n";a+="    "+b;if("author" in c&&c.author!==""){a+=',\n    author = "'+c.author+'"'}if("title" in c&&c.title!==""){a+=',\n    title = "'+c.title+'"'}if("booktitle" in c&&c.booktitle!==""){a+=',\n    booktitle = "'+c.booktitle+'"'}if("location" in c&&c.location!==""){a+=',\n    location = "'+c.location+'"'}if("month" in c&&c.month!==""){a+=",\n    month = "+c.month}if("year" in c&&c.year!==""){a+=",\n    year = "+c.year}if("numpages" in c&&c.numpages!==""){a+=",\n    numpages = "+c.numpages}if("note" in c&&c.note!==""){a+=',\n    note = "'+c.note+'"'}a+="\n}";return a}function getBibtexForArticle(c,b){var a="@article{\n";a+="    "+b;if("author" in c&&c.author!==""){a+=',\n    author = "'+c.author+'"'}if("title" in c&&c.title!==""){a+=',\n    title = "'+c.title+'"'}if("journal" in c&&c.journal!==""){a+=',\n    journal = "'+c.journal+'"'}if("volume" in c&&c.volume!==""){a+=',\n    volume = "'+c.volume+'"'}if("number" in c&&c.number!==""){a+=',\n    number = "'+c.number+'"'}if("pages" in c&&c.pages!==""){a+=',\n    pages = "'+c.pages+'"'}if("month" in c&&c.month!==""){a+=",\n    month = "+c.month}if("year" in c&&c.year!==""){a+=",\n    year = "+c.year}if("numpages" in c&&c.numpages!==""){a+=",\n    numpages = "+c.numpages}if("note" in c&&c.note!==""){a+=',\n    note = "'+c.note+'"'}a+="\n}";return a}function getBibtexForTechReport(c,b){var a="@techreport{\n";a+="    "+b;if("author" in c&&c.author!==""){a+=',\n    author = "'+c.author+'"'}if("title" in c&&c.title!==""){a+=',\n    title = "'+c.title+'"'}if("number" in c&&c.number!==""){a+=',\n    number = "'+c.number+'"'}if("institution" in c&&c.institution!==""){a+=',\n    institution = "'+c.institution+'"'}if("month" in c&&c.month!==""){a+=",\n    month = "+c.month}if("year" in c&&c.year!==""){a+=",\n    year = "+c.year}a+="\n}";return a}function getBibtexForBook(c,b){var a="@book{\n";a+="    "+b;if("author" in c&&c.author!==""){a+=',\n    author = "'+c.author+'"'}if("title" in c&&c.title!==""){a+=',\n    title = "'+c.title+'"'}if("year" in c&&c.year!==""){a+=",\n    year = "+c.year}if("publisher" in c&&c.publisher!==""){a+=",\n    publisher = "+c.publisher}a+="\n}";return a}function getBibtexForCollection(c,b){var a="@incollection{\n";a+="    "+b;if("author" in c&&c.author!==""){a+=',\n    author = "'+c.author+'"'}if("title" in c&&c.title!==""){a+=',\n    title = "'+c.title+'"'}if("booktitle" in c&&c.booktitle!==""){a+=',\n    booktitle = "'+c.booktitle+'"'}if("location" in c&&c.location!==""){a+=',\n    location = "'+c.location+'"'}if("month" in c&&c.month!==""){a+=",\n    month = "+c.month}if("year" in c&&c.year!==""){a+=",\n    year = "+c.year}if("pages" in c&&c.pages!==""){a+=",\n    pages = "+c.pages}if("note" in c&&c.note!==""){a+=',\n    note = "'+c.note+'"'}a+="\n}";return a}function getStringForPublication(c){var d="";var a="";var b="";if("key" in c&&c.key!==""){b=c.key}else{b=""+Math.floor((Math.random()*100000)+1)}if("type" in c&&c.type==="proceedings"){d=getReferenceForProceeding(c);a=getBibtexForProceeding(c,b)}else{if("type" in c&&c.type==="journal"){d=getReferenceForArticle(c);a=getBibtexForArticle(c,b)}else{if("type" in c&&c.type==="techreport"){d=getReferenceForTechReport(c);a=getBibtexForTechReport(c,b)}else{if("type" in c&&c.type==="book"){d=getReferenceForBook(c);a=getBibtexForBook(c,b)}else{if("type" in c&&c.type==="collection"){d=getReferenceForProceeding(c);a=getBibtexForCollection(c,b)}else{return""}}}}}if("links" in c&&typeof c.links==="object"){for(key in c.links){if(c.links[key]!==""){d+='[<a href="'+c.links[key]+'" target="_blank">'+key+"</a>] "}}}d+='[<a class="cursor-pointer" data-toggle="modal" data-target="#bibtexModal" data-entry="'+b+'">Bibtex</a>] ';d+='<span class="hide" id="'+b+'">'+a+"</span>";return d};